$.an8=["This is Organization internal project for B2B domain.\nAgents add/paste their leads in QA Platform(Web Application) andthis leads are display in QA Dashboard.\nDisplay leads, campaigns, points graph by date wise, month wise, yearwise and date range.\nDisplay Dashboard screen for date,month,year and date range.\nDisplay all agents list and their leads counts,for that month, if you click a agent it will display it to thair monthly records.","This app is design same like as Zomato,Swiggy etc.\nPerform all CRUD operations.\nLogged in functionality using contact number, gmail/google.\nAdd products to their details like name, price, category, description, and type.\nGet list of all products.\nAdd products to cart, wishlist, and order to this product.\nUse offers and their code.\nGet current location of user.\nGet logged in user data like wishlist items, cart items, Order item.\nUse RazorPay payment getway in that for placing the order.\nAnd other e-commerse app functionality.\n"]
$.ane=["In dashboard screen display the agent name on their leads count.\nIn TV/Web screens display the graphs like Column chart and mobile device Bar chart.\nDisplay alert depend on device like  device isAndroid/windows then display AlertDialog and device is iOS/mac then display CupertinoAlertDialog etc.\nApp is must working on TV as well as other devices","Get User current location with their lattitude and longitude.\nGet logged in user correct data.\nAdd messages/alerts for adding/deleting product to cart/wishlist/orders.\nUpdate logged in user information.\nGet the product list with their brand and category wise.\nSet the list of populer and suggested product.\nGet payment integration using razorpay.\nPayment is success or not status and see the Razorpay dashboard.\n"]
